import React from 'react'
import { GluestackUIProvider, ImageBackground, View, Text } from '@gluestack-ui/themed'
import { config } from '@gluestack-ui/config'

export default function EditPage() {
    return (
        <GluestackUIProvider config={config}>
            <ImageBackground
                source={require('../img/bg.png')}
                style={{ flex: 1 }}>
                <View>
                    <Text m='$4' size='4xl' fontWeight='$bold'>This is Header</Text>
                </View>
            </ImageBackground>
        </GluestackUIProvider>
    )
}
